import Employes from './Employes';
 const EmployeeLists = () => {
  return (
    <div class="container-xl">
	<div class="table-responsive">
		<div class="table-wrapper">
    <Employes/>
    </div>
    </div>
    </div>
  )
}
export default EmployeeLists;
